import React from "react";

const RepoInfo = ({ repo }) => {
  return (
    <div>
      <li className="list-group-item" key={repo.id.toString()}>
        <a className="h5 mb-0 text-decoration-none" href={repo.url}>
          {repo.name}
        </a>
        <p className="small">{repo.description}</p>
      </li>
    </div>
  );
};

export default RepoInfo;
